import React from "react";
import bg0 from "../../../media/bg-0.jpg";
import AllImages from "./AllImages";

const Landing = (props) => {
  return (
    <div
      style={{
        height: "100vh",
        marginTop: "45px",
        backgroundColor: "rgba(255,0,0,0.1)",
      }}
    >
      Landing
      <div className="col-2">
      <AllImages/>
      </div>
    </div>
  );
};

export default Landing;
